  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA's polar-orbiting satellites measure
  SST around the globe in near-real-time, and Coral Reef Watch produces a suite of
  products derived from this set of satellite SST and uses them to pinpoint areas
  around the world where corals are at risk for bleaching. This is a suite of operational
  products produced at 0.5 degree (approximately 50 km) spatial resolution twice-weekly.
  The products include nighttime sea surface temperature, nighttime sea surface temperature
  anomaly, coral bleaching HotSpots, and Degree Heating Weeks for the global oceans.\",\n\t\"license_title\":
